syntax = "proto3";

import "GetWebviewCacheInfo/Offpack.proto";
import "GetWebviewCacheInfo/PackageInfo.proto";

message DataRes {
    string src = 1;
    string webview_version = 2;
    string md5 = 3;
    PackageInfo latest = 4;
    repeated PackageInfo patch = 5;
    string version = 6;
    repeated Offpack offpack_list = 7;
}
